PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "core_usermodel_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usermodel_id" bigint NOT NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_usermodel_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usermodel_id" bigint NOT NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "core_userinviterelate" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "invite_id" integer NULL REFERENCES "core_userinvitecode" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "belong_id" integer NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "invite_user_unique_id" varchar(10) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "core_userinvitecode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "code" varchar(10) NOT NULL UNIQUE, "used" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "store_productbrand" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(255) NOT NULL, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "store_productcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(255) NOT NULL, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "store_productskugroup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(255) NOT NULL, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "store_productsku" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(255) NOT NULL, "description" text NOT NULL, "group_id" integer NOT NULL REFERENCES "store_productskugroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_product_skus" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_id" integer NOT NULL REFERENCES "store_product" ("id") DEFERRABLE INITIALLY DEFERRED, "productskugroup_id" integer NOT NULL REFERENCES "store_productskugroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "urlzip_link" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "is_deleted" bool NOT NULL, "url" varchar(2000) NOT NULL UNIQUE, "description" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "sort_url" varchar(10) NOT NULL UNIQUE, "status" varchar(10) NOT NULL, "posted_by_id" integer NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "urlzip_visitorip" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "ip" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "link_id" integer NULL REFERENCES "urlzip_link" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "urlzip_qrcode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "originUrl" varchar(2000) NULL, "text" text NOT NULL, "image" varchar(100) NOT NULL, "short_id" integer NULL REFERENCES "urlzip_link" ("id") DEFERRABLE INITIALLY DEFERRED, "type" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "store_productskugroup_products" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "productskugroup_id" integer NOT NULL REFERENCES "store_productskugroup" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "store_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_usertoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "token" varchar(100) NOT NULL UNIQUE, "expired_at" datetime NOT NULL, "user_id" integer NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "browser" varchar(100) NULL, "device" varchar(100) NULL, "ip" varchar(100) NULL, "is_mobile" bool NOT NULL, "location" varchar(100) NULL, "platform" varchar(100) NULL, "ua" varchar(1000) NULL);
CREATE TABLE IF NOT EXISTS "core_usermodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "uuid" char(32) NOT NULL, "bio" text NOT NULL, "point" integer NOT NULL, "created_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "updated_at" datetime NOT NULL, "avatar" varchar(1000) NULL);
CREATE TABLE IF NOT EXISTS "store_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(255) NOT NULL, "price" decimal NOT NULL, "image" varchar(100) NULL, "description" text NOT NULL, "category_id" integer NOT NULL REFERENCES "store_productcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "status" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "core_post" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "title" varchar(100) NOT NULL, "content" text NOT NULL, "user_id" integer NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "core_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "name" varchar(100) NOT NULL, "code" varchar(100) NOT NULL, "description" varchar(1000) NULL, "is_enabled" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "core_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "core_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "core_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_userpermission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "permission_id" integer NOT NULL REFERENCES "core_permission" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "core_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "core_tablemanager" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "title" varchar(100) NOT NULL, "description" varchar(1000) NULL, "api_url" varchar(1000) NULL, "columns" text NULL, "add_form_fields" text NULL, "key" varchar(100) NOT NULL UNIQUE, "search_form_fields" text NULL);
CREATE TABLE IF NOT EXISTS "core_menu" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "uuid" char(32) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_deleted" bool NOT NULL, "title" varchar(100) NOT NULL, "icon" varchar(100) NULL, "component" varchar(100) NULL, "path" varchar(100) NULL, "key" varchar(100) NULL, "pid" integer NULL);
